	public static List<GeoPoint> getPositionList() {
		Random r = new Random();		
		List<GeoPoint> positions = new ArrayList<GeoPoint>();
		String[] coord = list[r.nextInt(2)].split(";");
		
		for (String c : coord) {
			String[] pos = c.split(",");
			positions.add(new GeoPoint((int)(Double.parseDouble(pos[0]) * 1E6), (int)(Double.parseDouble(pos[1]) * 1E6)));
		}
		
		return positions;
	}

